Mongoose: How to find by 2 fields where one field exists in document and other in sub-documents?<p>Below is my schema.</p>

<pre><code>var prayerSchema = new Schema({
    totalSteps:{
      type: Number
    },
    name: String,
    steps: [{type: Schema.Types.ObjectId, ref:'Step'}]
});


var stepSchema = new Schema({
    stepNumber : {
       type: Number
    },
    _prayer : {
         type: Schema.Types.ObjectId, ref: 'Prayer', required: true
    } 
 });
</code></pre>

<p>Each prayer will have totalsteps, name and steps. <br>
Each steps will have stepNumber and prayerModel associated with it. <br>
Step document will look like this: <br></p>

<pre><code>{
   "stepNumber":1,
   _prayer:[
       "name":"prayer1",
       "totalSteps":5,
       "steps":[]
    ] 
 },
 {
    "stepNumber":2,
    _prayer:[
        "name":"prayer2",
        "totalSteps":10,
        "steps":[]
     ]   
  }
</code></pre>

<p>I am trying to query by name exists in sub-document(_prayer) of stepSchema and stepNumber of stepSchema.</p>

<pre><code>Step.find({_prayer :{ name: req.query.name} }, {stepNumber: 1});
Step.find({'_prayer.name' : req.query.name, stepNumber: 1});
</code></pre>

<p>Both these above codes didnot work.
One way I found is to query <strong>Prayer</strong>  document first by its name and get its _id and query again <strong>Step</strong> document by the found _id and stepNumber.</p>

<pre><code>Prayer.findOne({name:"name"})
   .exec((err, prayers) =&gt; {

    Rakah.find({ _prayer: prayers._id, stepNumber: stepNumber })

    ....
});
</code></pre>

<p>But this approach will become difficult for nested documents.  
Are there any ways to query by one document only to get the result ?</p>

