MongoDB Group and aggregate with multiple docs inside one doc<p>I would like to aggregate from a collection with 2 fields:</p>

<pre><code>var StatusSchema = mongoose.Schema({
    Demonstrator: SchemaTypes.Long, 
    DemoBetriebsbereit: Boolean
}
</code></pre>

<p>My aggregation function should aggregate by Demonstrator, as wells as by DemoBetriebsbereit field, and then count the occurences for each combination.
The aggregation function looks like this:</p>

<pre><code>    exports.getStatusDemonstrators = function(req,res) {
        Status.aggregate([
            {
                $match: {
                    "DemoBetriebsbereit": {$exists:1}
                }
            },
            {
                $group: {
                    _id: {Demonstrator: "$Demonstrator", betriebsbereit: 
                          "$DemoBetriebsbereit"}, Anzahl: {$sum:1}
                }
            }
